There are several acts by the name of Disturbed;

1) Well-known American hard rock band with lead singer David Draiman, formed in 1996, with several albums including The Sickness (Giant/Reprise 2000), Believe (Giant/Reprise 2002), Ten Thousand Fists (Reprise, 2005), Indestructible (Reprise, 2008), Asylum (Reprise, 2010), and Immortalized (Reprise, 2015).
2) Late 80's American Thrash band who released the album Disturbing the Peace in 1988; formed by Earl Root in 86/87 and disbanded in 92/93 before his death in 2008. <a href="https://www.last.fm/music/Disturbed">Read more on Last.fm</a>
